import Link from 'next/link';

import Square from '..components/Square.css'

export default function Index() {
  return (
    <div>
        <Square>
      <Link href="/about">
        <a>About Page</a>
      </Link>
      <p>Hello Next.js</p>
      </Square>
    </div>
  );
}
